pragma solidity ^0.5.0;

contract ImgStorage {
    string public name = 'ImgStorage';
    uint public imgCount = 0;
    mapping(uint => Image) public images;

    struct Image {
        uint imgId;
        string imgHash;
        uint imgSize;
        string imgType;
        string imgName;
        uint uploadTime;
        address payable uploader;
    }

    event ImageUploaded(
        uint imgId,
        string imgHash,
        uint imgSize,
        string imgType,
        string imgName,
        uint uploadTime,
        address payable uploader 
    );

    constructor() public {
        
    }

    function uploadImage (string memory _imgHash, uint _imgSize, string memory _imgType, string memory _imgName) public {
        //make sure the image hash exists
        require(bytes(_imgHash).length > 0);
        //make sure file type exists
        require(bytes(_imgType).length > 0);
        //make sure file name exists
        require(bytes(_imgName).length > 0);
        //make sure uploader address exists
        require(msg.sender!=address(0));
        //make sure file size is more than 0
        require(_imgSize>0);

        //Increment the image ID
        imgCount ++;

        //Add image to the contract
        images[imgCount] = Image(imgCount, _imgHash, _imgSize, _imgType, _imgName, now, msg.sender);
        //trigger an event
        emit ImageUploaded(imgCount, _imgHash, _imgSize, _imgType, _imgName, now, msg.sender);
    }
}
